import React from 'react'
import { FaUserFriends } from "react-icons/fa";
import { GrGroup } from "react-icons/gr";
import { FaFacebook } from "react-icons/fa";
import { BsFillBookmarksFill } from "react-icons/bs";
import { BsFillStopwatchFill } from "react-icons/bs";
import { MdEvent } from "react-icons/md";
import { GrTableAdd } from "react-icons/gr";
import { SiGoogleadsense } from "react-icons/si";
import { BiDonateBlood } from "react-icons/bi";
import { FaFacebookMessenger } from "react-icons/fa";
import { BiSave } from "react-icons/bi";
import { SiPagekit } from "react-icons/si";
import { BiUpArrowAlt } from "react-icons/bi";

function Leftbar() {
    return (
        <div className="leftbar">
            
            <div className="leftside">
            <div style={{height:'30px',width:'30px',backgroundColor:'blue',borderRadius:'50px'}}></div>
           <div style={{height:'500px',width:'50px',display:'flex',flexDirection:'column',justifyContent:'space-around'}}>
              
              
               <FaUserFriends style={{height:'25px',width:'25px'}}></FaUserFriends>
            <GrGroup style={{height:'25px',width:'25px'}}></GrGroup>
            <FaFacebook style={{height:'25px',width:'25px'}}></FaFacebook>
            <BsFillBookmarksFill style={{height:'25px',width:'25px'}}></BsFillBookmarksFill>
            <BsFillStopwatchFill style={{height:'25px',width:'25px'}}></BsFillStopwatchFill>
            <MdEvent style={{height:'25px',width:'25px'}}></MdEvent>
            <GrTableAdd style={{height:'25px',width:'25px'}}></GrTableAdd>
            <SiGoogleadsense style={{height:'25px',width:'25px'}}></SiGoogleadsense>
            <BiDonateBlood style={{height:'25px',width:'25px'}}></BiDonateBlood>
            <FaFacebookMessenger style={{height:'25px',width:'25px'}}></FaFacebookMessenger>
            <BiSave style={{height:'25px',width:'25px'}}></BiSave>
            <SiPagekit style={{height:'25px',width:'25px'}}></SiPagekit>
            <BiUpArrowAlt style={{height:'25px',width:'25px'}}></BiUpArrowAlt>
           
            </div> 
            </div>
            <div className="rightside">
<h4>Jannat Islam</h4>
<h4>Friends</h4>
<h4>Groups</h4>
<h4>welcome</h4>
<h4>saved</h4>
<h4>Marketplace</h4>
<h4>Events</h4>
<h4>add manager</h4>
<h4></h4>
<h4></h4>
<h4></h4>
<h4></h4>
            </div>
        </div>
    )
}

export default Leftbar
